pub enum RemoteProcedure<T: Metadata> {
    Method(Arc<dyn RpcMethod<T>>),
    Notification(Arc<dyn RpcNotification<T>>),
    Alias(String),
}

pub enum Params {
    None,
    Array(Vec<Value>),
    Map(serde_json::Map<String, Value>),
}

pub enum Call {
    MethodCall(MethodCall),
    Notification(Notification),
    Invalid {
        id: Id,
    },
}
